  palette: {
    mode: 'dark',
  },
})
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <ContextProvider>
<ThemeProvider theme={darkTheme}>
  <CssBaseline />
  <App />
</ThemeProvider>
